import React from 'react';
import { useTimer } from 'react-timer-hook'
function Timer({endTime}){
    const { time, start, pause, reset, status } = useTimer({
        endTime,
        onTimeOver: () => {
        console.log('Time is over');
        },
    });
    return(
        <div>{time}</div>
    )
}
export default Timer
